class StreamlitTravelAssistant:
    def __init__(self):
        self.processor = None
        self.retriever = None
        self.embedder = None
        self.initialized = False
        
    def initialize_components(self):
        """Initialize all components if not already done"""
        if not self.initialized:
            try:
                with st.spinner("Initializing system components..."):
                    Logger.verbosity = 1
                    self.processor = Preprocessor()
                    self.retriever = GraphRetriever()
                    self.embedder = EmbeddingManager()
                    self.initialized = True
            except Exception as e:
                st.error(f"Initialization failed: {str(e)}")
                return False
        return True
    
    def check_environment(self):
        """Check if required environment variables are set"""
        required_vars = ["HF_TOKEN", "NEO4J_PASSWORD", "NEO4J_URI"]
        missing_vars = [var for var in required_vars if not os.environ.get(var)]
        
        if missing_vars:
            st.error(f"Missing configuration: {', '.join(missing_vars)}")
            return False
        return True
    
    def process_query(self, query: str, model_name: str, retrieval_method: str) -> Dict[str, Any]:
        """Process a single query and return structured results"""
        results = {
            "intent": None,
            "entities": {},
            "baseline_results": [],
            "embedding_results": [],
            "cypher_queries": [],
            "final_answer": "",
            "error": None,
            "processing_time": 0
        }
        
        start_time = time.time()
        
        try:
            # Step 1: Analyze request
            intent, entities = self.processor.process(query)
            results["intent"] = intent.category
            results["entities"] = entities.model_dump()
            
            # Step 2: Retrieve from Knowledge Graph
            baseline_results = []
            embedding_results = []
            
            # Skip retrieval for greetings
            if intent.category != "greeting":
                if retrieval_method in ["baseline", "both"]:
                    baseline_results = self.retriever.retrieve_baseline(intent, entities)
                    if hasattr(self.retriever, 'last_queries'):
                        results["cypher_queries"] = self.retriever.last_queries
                
                if retrieval_method in ["embeddings", "both"]:
                    if intent.category in ["search", "recommendation"]:
                        embedding_results = self.embedder.search_similar_hotels(query)
            
            results["baseline_results"] = baseline_results
            results["embedding_results"] = embedding_results
            
            # Step 3: Generate LLM response
            if retrieval_method == "both":
                context = baseline_results + embedding_results
            elif retrieval_method == "embeddings":
                context = embedding_results
            else:
                context = baseline_results
            
            # If no context found AND it's not a greeting, show fallback.
            # If it IS a greeting, we let the LLM handle it even with empty context.
            if not context and intent.category != "greeting":
                results["final_answer"] = "I'm sorry, but the knowledge base doesn't contain any information relevant to your query."
            else:
                formatted_query = Inference.format_prompt(query, context)
                client = Inference.setup_inference()
                response = Inference.call_model(client, model_name, formatted_query)
                results["final_answer"] = response

        except Exception as e:
            # Log the actual error for debugging (visible in console)
            print(f"Error processing query: {str(e)}")
            traceback.print_exc()
            
            # User-facing friendly error message
            results["error"] = "Processing Error"
            results["final_answer"] = "I apologize, but I encountered a temporary issue while processing your request. Please try asking your question again."
        
        results["processing_time"] = time.time() - start_time
        return results
    
    def display_results(self, results: Dict[str, Any], widget_key: str = None):
        """Display the results in a clean, professional format"""
        
        # Main Answer
        st.markdown("### Response")
        if results["error"]:
            st.error(results["final_answer"])
        else:
            st.markdown(f'<div class="result-card">{results["final_answer"]}</div>', unsafe_allow_html=True)
        
        # Toggle for System Internals
        # Use a unique key if provided, otherwise fallback to a random one (though random is bad for persistence)
        key = f"toggle_{widget_key}" if widget_key else None
        show_debug = st.toggle("View System Internals", value=False, key=key)
        
        if show_debug:
            # Key Metrics (Subtle)
            col1, col2, col3 = st.columns(3)
            with col1:
                st.caption(f"Intent: {results['intent'] or 'Unknown'}")
            with col2:
                st.caption(f"Time: {results['processing_time']:.2f}s")
            with col3:
                ent_count = len([v for v in results["entities"].values() if v])
                st.caption(f"Entities: {ent_count}")

            # Details Expander
            with st.expander("View Retrieval Details & Debug Info", expanded=True):
                st.markdown("#### Extracted Entities")
                if any(results["entities"].values()):
                    st.json({k: v for k, v in results["entities"].items() if v})
                else:
                    st.write("No specific entities extracted.")
                    
                st.markdown("#### Knowledge Graph Context")
                tab1, tab2 = st.tabs(["Structured (Cypher)", "Semantic (Embeddings)"])
                
                with tab1:
                    if results["cypher_queries"]:
                        st.markdown("**Executed Queries:**")
                        for q in results["cypher_queries"]:
                            st.markdown(f'<div class="code-block">{q}</div>', unsafe_allow_html=True)
                    
                    if results["baseline_results"]:
                        st.markdown("**Results:**")
                        st.json(results["baseline_results"])
                    else:
                        st.info("No structured matches found.")
                
                with tab2:
                    if results["embedding_results"]:
                        st.json(results["embedding_results"])
                    else:
                        st.info("No semantic matches found.")

@st.cache_resource
def get_assistant():
    return StreamlitTravelAssistant()

def main():
    # Sidebar
    with st.sidebar:
        # Logo
        try:
            st.image("assets/horus_logo.png", width=300)
        except:
            st.title("HoRuS")
            
        st.markdown("### Configuration")
        
        # Environment Check
        assistant = get_assistant()
        if not assistant.check_environment():
            st.stop()
            
        # Settings
        selected_model = st.selectbox(
            "Model", 
            Inference.models,
            index=0
        )
        
        retrieval_method = st.selectbox(
            "Retrieval Method",
            ["baseline", "embeddings", "both"],
            index=2,
            format_func=lambda x: x.title()
        )
        

        
    # Main Content - Custom Header
    st.markdown("""
<div style="display: flex; align-items: center; margin-bottom: 20px;">
    <div>
        <h1 style="margin: 0; font-size: 2.2rem; color: var(--royal-gold);">HoRuS Travel Assistant</h1>
        <p style="margin: 5px 0 0 0; color: var(--muted-sand); font-style: italic;">Ask questions about hotels, locations, and travel recommendations.</p>
    </div>
</div>
""", unsafe_allow_html=True)
    
    # Initialize
    if not assistant.initialize_components():
        st.stop()
    
    # Query Interface
    query = st.chat_input("How can I help you with your travel plans?")
    
    # Session State for History
    if 'messages' not in st.session_state:
        st.session_state.messages = []
        
    # Display Chat History
    for message in st.session_state.messages:
        if message["role"] == "assistant":
            avatar_url = "assets/pharaoh_avatar.png"
            with st.chat_message(message["role"], avatar=avatar_url):
                if "results" in message:
                    # Render the details for past messages using the stored ID as key
                    assistant.display_results(message["results"], widget_key=message.get("id"))
                else:
                    st.markdown(message["content"])
        elif message["role"] == "user":
            user_avatar_url = "assets/user_avatar.png"
            with st.chat_message("user", avatar=user_avatar_url):
                st.markdown(message["content"])

    # Process New Query
    if query and query.strip():
        # User Message
        st.session_state.messages.append({"role": "user", "content": query})
        with st.chat_message("user", avatar="assets/user_avatar.png"):
            st.markdown(query)
            
        # Assistant Response
        avatar_url = "assets/pharaoh_avatar.png"
        with st.chat_message("assistant", avatar=avatar_url):
            # Custom Typing Indicator
            placeholder = st.empty()
            placeholder.markdown('<div class="typing-indicator">Typing<span class="typing-dots"></span></div>', unsafe_allow_html=True)
            
            try:
                results = assistant.process_query(query, selected_model, retrieval_method)
            finally:
                # Clear the typing indicator
                placeholder.empty()
                
            # Generate a unique ID for this message
            msg_id = str(uuid.uuid4())
            assistant.display_results(results, widget_key=msg_id)
                
        st.session_state.messages.append({
            "role": "assistant", 
            "content": results["final_answer"],
            "results": results,
            "id": msg_id
        })

if __name__ == "__main__":

    main()
